import React from "react";

function TeamMember(props) {
  return (
    <div className="cardContainer">
      <div className="card">
        <div className="cardImg">
          <img src={props.Member.img} />
        </div>
        <div className="cardContent">
          <h2>{props.Member.name}</h2>
        </div>
      </div>
    </div>
  );
}

export default TeamMember;
